import './Logs.css'
const Logs = ()=>{
  const logsData = [
    {    
      data: new Date(2022,5,22,19,0),
      desc: "学习前端",
      time: 30
    },
    {    
      data: new Date(2023,5,10,5,30),
      desc: "学习前端",
      time: 30
    },
  ]
  return <div className="logs">
    <Logitem date={new Date(2022,5,22,19,0)} desc={"学习前端"} time={"50分钟"}/>
    <Logitem date={new Date(2023,5,10,5,30)} desc={"学习React"} time={"60分钟"}/>
  </div>
}
export default Logs
